import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import {BrowserRouter} from 'react-router-dom';


ReactDOM.render(

    //browserRouter gives our <app/> all the functionality of routing
    <BrowserRouter> 
        <App />
    </BrowserRouter>
    , document.getElementById('root'));
